    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image3.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "additional-resources"
    }}>{`Additional Resources`}</h2>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://oss.redislabs.com/redistimeseries/"
        }}>{`RedisTimeSeries Project`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/howtos/redistimeseries"
        }}>{`RedisTimeSeries Tutorial`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "explore/redisinsight/profiler"
        }}>{`Analyze Your Redis commands using RedisInsight Profiler tool`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://redislabs.com/blog/how-to-manage-real-time-iot-sensor-data-in-redis/"
        }}>{`How to Manage Real-Time IoT Sensor Data in Redis`}</a></li>
    </ul>
    </MDXLayout>;
}

;
